":\"#000000\"},\"elements\":[],\"widgetType\":\"heading\"},{\"id\":\"0a99841\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<p>Ans: My previous work experience includes innovation in many areas, including strategies for more effective teamwork. At my previous company, I devised strategies for improving teamwork and communication among members of team projects. I can bring to your organization not only my ideas from my previous job, but my general passion for innovation too.<\\/p>\"},\"elements\":[],\"widgetType\":\"text-editor\"},{\"id\":\"290f81c\",\"elType\":\"widget\",\"settings\":{\"text\":\"Divider\"},\"elements\":[],\"widgetType\":\"divider\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"4580226\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"bfd03f7\",\"elType\":\"column\",\"settings\":{\"_column_size\":100,\"_inline_size\":null},\"elements\":[{\"id\":\"7dd649f\",\"elType\":\"widget\",\"settings\":[],\"elements\":[],\"widgetType\":\"spacer\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"f7a600f\",\"elType\":\"section\",\"settings\":{\"animation\":\"slideInLeft\",\"background_overlay_background\":\"classic\",\"background_overlay_color\":\"#DADADA\"},\"elements\":[{\"id\":\"fbae944\",\"elType\":\"column\",\"settings\":{\"_column_size\":100,\"_inline_size\":null},\"elements\":[{\"id\":\"6830975\",\"elType\":\"widget\",\"settings\":{\"text\":\"Divider\"},\"elements\":[],\"widgetType\":\"divider\"},{\"id\":\"db49e4e\",\"elType\":\"widget\",\"settings\":{\"title\":\"c. In 5 years of time, how would you imagine yourself to be?\",\"header_size\":\"h4\",\"title_color\":\"#000000\"},\"elements\":[],\"widgetType\":\"heading\"},{\"id\":\"b352ea7\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<p>Ans: My ultimate goal for the next five years is to master my position and advance into a managerial role within my department. I was drawn to the personalized training approach your company outlines on its website, and I truly believe this approach to training will allow me to learn new skills and grow within this position. Over the next five years, I see myself taking on new and exciting projects within your company that will prepare me for a management role with the organization.<\\/p>\"},\"elements\":[],\"widgetType\":\"text-editor\"},{\"id\":\"85f1584\",\"elType\":\"widget\",\"settings\":{\"text\":\"Divider\"},\"elements\":[],\"widgetType\":\"divider\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"a4f3cd5\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"a90f0de\",\"elType\":\"column\",\"settings\":{\"_column_size\":100,\"_inline_size\":null},\"elements\":[{\"id\":\"988be55\",\"elType\":\"widget\",\"settings\":[],\"elements\":[],\"widgetType\":\"spacer\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"62da1f5\",\"elType\":\"section\",\"settings\":{\"animation\":\"slideInRight\",\"background_overlay_background\":\"classic\",\"background_overlay_color\":\"#DADADA\"},\"elements\":[{\"id\":\"341631a\",\"elType\":\"column\",\"settings\":{\"_column_size\":100,\"_inline_size\":null},\"elements\":[{\"id\":\"a96b44c\",\"elType\":\"widget\",\"settings\":{\"text\":\"Divider\"},\"elements\":[],\"widgetType\":\"divider\"},{\"id\":\"efc28ed\",\"elType\":\"widget\",\"settings\":{\"title\":\"d. What are the Top 3 questions you would like to ask the Company?\",\"header_size\":\"h4\",\"title_color\":\"#000000\"},\"elements\":[],\"widgetType\":\"heading\"},{\"id\":\"5306c92\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<p>1. What makes someone successful at this company?<br \\/>2. What is the most important impact I could make in the first 90 days?<br \\/>3. When you saw my background, what persuaded you to interview me?<\\/p>\"},\"elements\":[],\"widgetType\":\"text-editor\"},{\"id\":\"20bf1b9\",\"elType\":\"widget\",\"settings\":{\"text\":\"Divider\"},\"elements\":[],\"widgetType\":\"divider\"}],\"isInner\":false}],\"isInner\":false}]'),
