{margin-left:0}.elementor-widget-divider--element-align-right .elementor-divider .elementor-divider-separator>.elementor-divider__svg:last-of-type{-webkit-box-flex:0;-ms-flex-positive:0;flex-grow:0;-ms-flex-negative:100;flex-shrink:100}.elementor-widget-divider--element-align-right .elementor-divider-separator:after{content:none}.elementor-widget-divider--element-align-right .elementor-divider__element{margin-right:0}.elementor-widget-divider:not(.elementor-widget-divider--view-line_text):not(.elementor-widget-divider--view-line_icon) .elementor-divider-separator{border-top:var(--divider-border-width) var(--divider-border-style) var(--divider-color)}.elementor-widget-divider--separator-type-pattern{--divider-border-style:none}.elementor-widget-divider--separator-type-pattern.elementor-widget-divider--view-line .elementor-divider-separator,.elementor-widget-divider--separator-type-pattern:not(.elementor-widget-divider--view-line) .elementor-divider-separator:after,.elementor-widget-divider--separator-type-pattern:not(.elementor-widget-divider--view-line) .elementor-divider-separator:before,.elementor-widget-divider--separator-type-pattern:not([class*=elementor-widget-divider--view]) .elementor-divider-separator{width:100%;min-height:var(--divider-pattern-height);-webkit-mask-size:var(--divider-pattern-size) 100%;mask-size:var(--divider-pattern-size) 100%;-webkit-mask-repeat:var(--divider-pattern-repeat);mask-repeat:var(--divider-pattern-repeat);background-color:var(--divider-color);-webkit-mask-image:var(--divider-pattern-url);mask-image:var(--divider-pattern-url)}.elementor-widget-divider--no-spacing{--divider-pattern-size:auto}.elementor-widget-divider--bg-round{--divider-pattern-repeat:round}.rtl .elementor-widget-divider .elementor-divider__text{direction:rtl}</style>		\n			<style>/*! elementor - v3.6.5 - 27-04-2022 */\n.elementor-heading-title{padding:0;margin:0;line-height:1}.elementor-widget-heading .elementor-heading-title[class*=elementor-size-]>a{color:inherit;font-size:inherit;line-height:inherit}.elementor-widget-heading .elementor-heading-title.elementor-size-small{font-size:15px}.elementor-widget-heading .elementor-heading-title.elementor-size-medium{font-size:19px}.elementor-widget-heading .elementor-heading-title.elementor-size-large{font-size:29px}.elementor-widget-heading .elementor-heading-title.elementor-size-xl{font-size:39px}.elementor-widget-heading .elementor-heading-title.elementor-size-xxl{font-size:59px}</style><h4>a. What is your aim to work in this Company?</h4>		\n		<p>Ans: My aim is to be part of a reputed company to enhance my skills and knowledge with great experience of working for the company.</p>		\n			<style>/*! elementor - v3.6.5 - 27-04-2022 */\n.e-container.e-container--row .elementor-spacer-inner{width:var(--spacer-size)}.e-container.e-container--column .elementor-spacer-inner,.elementor-column .elementor-spacer-inner{height:var(--spacer-size)}</style>		\n			<h4>b. What do you think you can do for the Company?</h4>		\n		<p>Ans: My previous work experience includes innovation in many areas, including strategies for more effective teamwork. At my previous company, I devised strategies for improving teamwork and communication among members of team projects. I can bring to your organization not only my ideas from my previous job, but my general passion for innovation too.</p>		\n			<h4>c. In 5 years of time, how would you imagine yourself to be?</h4>		\n		<p>Ans: My ultimate goal for the next five years is to master my position and advance into a managerial role within my department. I was drawn to the personalized training approach your company outlines on its website, and I truly believe this approach to training will allow me to learn new skills and grow within this position. Over the next five years, I see myself taking on new and exciting projects within your company that will prepare me for a management role with the organization.</p>		\n			<h4>d. What are the Top 3 questions you would like to ask the Company?</h4>		\n		<p>1. What makes someone successful at this company?<br />2. What is the most important impact I could make in the first 90 days?<br />3. When you saw my background, what persuaded you to interview me?</p>', 'FAQ', '', 'inherit', 'closed', 'closed', '', '99-revision-v1', '', '', '2022-05-04 20:44:54', '2022-05-04 12:44:54', '', 99, 'http://localhost/wordpress/?p=164', 0, 'revision', '', 0),
